import 'react-native-gesture-handler';
import * as React from 'react';
import { StyleSheet, Text,TextInput, View,Button,TouchableOpacity, FlatList } from 'react-native';

function MaintenanceHistoryScreen ({route, navigation}) {

  const {itemID, adminViewer,aircraftID,hangarID} = route.params;

//        onPress={() =>  navigation.navigate('Map',{itemID, adminViewer})}


  React.useLayoutEffect(() => {
    navigation.setOptions({
      headerRight: () => (
        <TouchableOpacity style={{}} 
        onPress = {() =>  navigation.navigate('Sign-in') } >
        <Text style={styles.rightHead} 
        >Log Out</Text>
      </TouchableOpacity>
      ),
    });
  }, [navigation]);

    const DATA = [
      {
        id: '0',
        title: '06-12-2020',
      },
      {
        id: '1',
        title: '05-11-2020',
      },
      {
        id: '2',
        title: '04-10-2020',
      },
      {
        id: '3',
        title: '05-09-2020',
      },
      {
        id: '4',
        title: '04-08-2020',
      },
      {
        id: '5',
        title: '03-07-2020',
      },
      {
        id: '6',
        title: '02-06-2020',
      },
      
    ];

    var i = aircraftID


    const Item = ({ title }) => (
      <View style={styles.item}>
        <Text style={styles.title} onPress={() => navigation.navigate('Air',{itemID, adminViewer,aircraftID,hangarID})}>{title}</Text>
      </View>
    );

    const renderItem = ({ item }) => (
      <Item title={item.title}/>
    );

    const air = ['hello ','world']
    const place = 'enter data...'

    return (
    
    <View style = {styles.back}>
        
      <View style={styles.info}>
        <Text style={styles.inputText}t>Aircraft Serial: </Text>
        <TextInput style={styles.infoField} placeholder={place}
            editable={adminViewer}> 
        </TextInput>
      </View>

      <View style={styles.info}>
        <Text style={styles.inputText}>Aircraft Type: </Text>
        <TextInput style={styles.infoField} placeholder={place}
            editable={adminViewer}> 
        </TextInput>
      </View>

      <View style={styles.info}>
        <Text style={styles.inputText}>Dates:</Text>
        <TextInput style={styles.infoField} placeholder={place}
            editable={adminViewer}> 
        </TextInput>
        <View style={{flex:1}}>
         <FlatList
          data={DATA}
          renderItem={renderItem}
          keyExtractor={item => item.id}
          />
        </View>
      </View>


    </View>

    )
  }

  const styles = StyleSheet.create({
    back:{flex: 1, 
      justifyContent: 'flex-start',
      alignItems: 'flex-start',
      backgroundColor: '#0a3161',
      padding: 10
    },
    container: {
      flex: 1,
      backgroundColor: "gray",
      alignItems: "center",
      justifyContent: "center",
    },
  
    image: {
      marginBottom: 40,
    },
  
    inputView: {
      backgroundColor: "#FF0000",
      borderRadius: 30,
      width: "70%",
      height: 45,
      marginBottom: 20,
      alignItems: "center",
    },

    history:{
      color: 'white',
      justifyContent: 'center',
      alignSelf: 'center',
      alignItems: 'center',
      marginLeft: '30%'
    },
  
    TextInput: {
      height: 50,
      flex: 1,
      padding: 10,
      marginLeft: 20,
      color: 'white'
    },
    titleText: {
      fontSize: 60,
    },
    rightHead:{
      color: '#fff',
      fontSize: 20,
      paddingRight: 10,
      fontWeight:'bold'
    },
  
    forgot_button: {
      height: 30,
      marginBottom: 30,
      color: 'white'
    },
    infoButton:{
      justifyContent: 'center', 
      alignItems: 'center',
      borderRadius: 20, 
      width: 170, 
      height: 70,
      backgroundColor: 'blue'
    },
    hangarInfo: {
      justifyContent: 'center',
      alignItems: 'center',
      padding:20,
    },
  
    loginBtn: {
     // width: "80%",
      borderRadius: 25,
    //  height: 50,
      alignItems: "center",
      justifyContent: "center",
     // marginTop: 40,
      backgroundColor: "#000080",
    },
    inputText: {
      color: 'white'
    },
    logo: {
      borderColor: "blue",
      borderWidth: 0,
      flex: 0.3,
      width: 200,
      height: 200,
      marginBottom: 10
      //resizeMode: 'contain',
    },
    usePass: {
     padding:10,
     flexDirection: 'row'
    },
    hangar : {
     flex: .5,
     justifyContent: 'center',
     backgroundColor: 'red', 
     height: 600,
     borderRadius: 40,
     margin: 30

    },
    bigBlue : {
      justifyContent: 'center',
      alignItems: 'center', 
      borderRadius: 20, 
      width: 70, 
      height: 70, 
      backgroundColor: 'blue' 

    },
    infoField:{
      flex: 0.8,
      fontSize: 30
    },
    input : {
      width: 200,
      borderColor: 'grey',
      borderBottomColor: 'black'
    },
    info: {
      
      backgroundColor: "#b31942",
      borderRadius: 30,
      width: "100%",
      height: 45,
      marginBottom: 9,
      flex: 0.6,
      flexDirection: 'row',
      padding: 10,
      borderTopColor: 'black',
      
    },
    
  })

export default MaintenanceHistoryScreen;
